import React, { Component } from "react";

class Quote extends Component {
  render() {
    let quote = "Life is not 10% always fair and just";
    let author = "Murial Anindo";
    return (
      <div style={{}}>
        <p style={{ textAlign: "center", color: "#fff" }}>"{quote}"</p>
        <p style={{ textAlign: "center" }}>- {author}</p>
      </div>
    );
  }
}

export default Quote;
